"937287":{"id":"937287","name":"Rivais","slug":"rivais","original_title":"Challengers","overview":"Tashi Duncan, atleta prodígio do tênis que se tornou treinadora, é uma força da natureza que não pede desculpas por seu jogo dentro e fora da quadra. Casada com um campeão que tem acumulado apenas derrotas nos últimos jogos, a estratégia de Tashi para a redenção de seu marido toma um rumo surpreendente quando ele deve enfrentar o fracassado Patrick nas quadras. Patrick foi o melhor amigo de seu marido, e é ex-namorado de Tashi. Quando o passado e o presente entram em colisão, e as tensões aumentam, Tashi deve se perguntar qual será o custo dessa vitória.","first_air_date":"2024-04-18","runtime":132,"episode_run_time":[132],"vote_average":7.0,"created_by":["Pascal Pictures","Why Are You Acting? Productions","Frenesy Film","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Pascal Pictures"},{"name":"Why Are You Acting? Productions"},{"name":"Frenesy Film"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Zendaya","Mike Faist","Josh O'Connor","Darnell Appling","Bryan Doo"],"backdrop_path":"https://image.tmdb.org/t/p/original/4CcUgdiGe83MeqJW1NyJVmZqRrF.jpg","poster_path":"https://image.tmdb.org/t/p/original/w1j3evHiwrGiQ6e9h1l9r66uo29.jpg","certification":"14","genres":["Romance","Drama"],"trailer":"uQOvYIdia9M"},
"664":{"id":"664","name":"Twister","slug":"twister","original_title":"Twister","overview":"Em Oklahoma está se anunciando uma tempestade que não acontece há décadas e dois grupos de cientistas rivais planejam entrar para a história colocando sensores no tornado, para que estas informações possam ir até um computador e, assim, seja possível prever sua chegada com maior antecedência. Mas para colocar os sensores, é necessário ficar o mais próximo possível do tornado e torcer para que os sensores sejam sugados pela tempestade. Em uma das equipes está uma jovem (Helen Hunt) obcecada por tal idéia, pois em 1969 ela viu o pai ser sugado por uma tempestade e atualmente ela planeja conseguir seu intento ou morrer tentando.","first_air_date":"1996-05-10","runtime":113,"episode_run_time":[113],"vote_average":6.5,"created_by":["Warner Bros. Pictures","Universal Pictures","Amblin Entertainment"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Universal Pictures"},{"name":"Amblin Entertainment"}],"cast":["Helen Hunt","Bill Paxton","Jami Gertz","Cary Elwes","Lois Smith"],"backdrop_path":"https://image.tmdb.org/t/p/original/5oCAo7LFj2x0yByfi5JYirGnK8I.jpg","poster_path":"https://image.tmdb.org/t/p/original/7QXT40RNaD0vac198G3O0U45m3y.jpg","certification":"L","genres":["Ação","Aventura","Drama"],"trailer":"N/A"},
"194":{"id":"194","name":"O Fabuloso Destino de Amélie Poulain","slug":"o-fabuloso-destino-de-amelie-poulain","original_title":"Le Fabuleux Destin d'Amélie Poulain","overview":"Após deixar a vida de subúrbio que levava com a família, a inocente Amélie muda-se para o bairro parisiense de Montmartre, onde começa a trabalhar como garçonete. Certo dia encontra uma caixa escondida no banheiro de sua casa e, pensando que pertencesse ao antigo morador, decide procurá-lo ­e é assim que encontra Dominique. Ao ver que ele chora de alegria ao reaver o seu objeto, a moça fica impressionada e adquire uma nova visão do mundo. Então, a partir de pequenos gestos, ela passa a ajudar as pessoas que a rodeiam, vendo nisto um novo sentido para sua existência. Contudo, ainda sente falta de um grande amor.","first_air_date":"2001-04-25","runtime":122,"episode_run_time":[122],"vote_average":7.9,"created_by":["Victoires Productions","Tapioca Films","France 3 Cinéma","MMC Independent","UGC"],"production_companies":[{"name":"Victoires Productions"},{"name":"Tapioca Films"},{"name":"France 3 Cinéma"},{"name":"MMC Independent"},{"name":"UGC"}],"cast":["Audrey Tautou","Mathieu Kassovitz","Rufus","Lorella Cravotta","Serge Merlin"],"backdrop_path":"https://image.tmdb.org/t/p/original/6n53UI4mX9QMfe2S0Pgt8mGebY1.jpg","poster_path":"https://image.tmdb.org/t/p/original/4zMUKCBq1OqMXFnNSLMVT0MgHXz.jpg","certification":"16","genres":["Comédia","Romance"],"trailer":"cYLFIJiFIjc"},
