"68735":{"id":"68735","name":"Warcraft - O Primeiro Encontro de Dois Mundos","slug":"warcraft-o-primeiro-encontro-de-dois-mundos","original_title":"Warcraft","overview":"A região de Azeroth sempre viveu em paz, até a chegada dos guerreiros Orc. Com a abertura de um portal, eles puderam chegar à nova Terra com a intenção de destruir o povo inimigo. Cada lado da batalha possui um grande herói, e os dois travam uma disputa pessoal, colocando em risco seu povo, sua família e todas as pessoas que amam.","first_air_date":"2016-05-25","runtime":123,"episode_run_time":[123],"vote_average":6.4,"created_by":["Legendary Pictures","Atlas Entertainment","Blizzard Entertainment","Tencent Pictures","Huayi Brothers Pictures","Taihe Entertainment","China Film Group Corporation","Media Corporation"],"production_companies":[{"name":"Legendary Pictures"},{"name":"Atlas Entertainment"},{"name":"Blizzard Entertainment"},{"name":"Tencent Pictures"},{"name":"Huayi Brothers Pictures"},{"name":"Taihe Entertainment"},{"name":"China Film Group Corporation"},{"name":"Media Corporation"}],"cast":["Travis Fimmel","Paula Patton","Ben Foster","Dominic Cooper","Ben Schnetzer"],"backdrop_path":"https://image.tmdb.org/t/p/original/aTGvZ3F8QnAD8cPpJRaaqRRxFK6.jpg","poster_path":"https://image.tmdb.org/t/p/original/2cPJhbIwsmMXsV9vihoPEFBFFHm.jpg","certification":"12","genres":["Ação","Aventura","Fantasia"],"trailer":"Dqvz8w-latE"},
"277217":{"id":"277217","name":"Descendentes","slug":"descendentes","original_title":"Descendants","overview":"Os principais vilões dos contos de fadas vivem isolados em uma ilha distante. Entretanto, quando o filho da Bela e da Fera assume o reino de Auradon, ele resolve perdoar os filhos dos vilões, permitindo que convivam e estudem na principal escola do local. É lá que Mal, filha de Malévola; Evie, filha da Rainha Má; Jay, filho de Jafar; e Carlos, filho de Cruela De Vil, precisarão decidir se seguirão o caminho dos pais ou se tomarão outro rumo.","first_air_date":"2015-07-31","runtime":112,"episode_run_time":[112],"vote_average":7.1,"created_by":["Bad Angels Productions, Ltd.","5678 Productions"],"production_companies":[{"name":"Bad Angels Productions, Ltd."},{"name":"5678 Productions"}],"cast":["Dove Cameron","Sofia Carson","Cameron Boyce","Booboo Stewart","Mitchell Hope"],"backdrop_path":"https://image.tmdb.org/t/p/original/y0ludgr1EvyXcT1lv2M0m621LQ6.jpg","poster_path":"https://image.tmdb.org/t/p/original/i36xiPRiRgy8x261fk80CyVcaYF.jpg","certification":"L","genres":["Família","Aventura","Fantasia","Cinema TV"],"trailer":"N/A"},
"826510":{"id":"826510","name":"Harold e o Lápis Mágico","slug":"harold-e-o-lapis-magico","original_title":"Harold and the Purple Crayon","overview":"Dentro do seu livro, o aventureiro Harold consegue fazer dar vida à qualquer coisa simplesmente a desenhando. Depois que ele cresce e se desenha fora das páginas do livro e dentro do mundo real, Harold descobre que ele tem muito o que aprender sobre a vida real – e que seu confiável lápis roxo pode criar mais diversão do que ele jamais achou possível. Quando o poder da imaginação ilimitada cai nas mãos erradas, vai precisar da criatividade de todos os amigos do Harold para salvar o mundo real e o seu próprio. Harold e o Lápis Mágico é a primeira adaptação da amada série de livros que cativou gerações por décadas.","first_air_date":"2024-07-31","runtime":90,"episode_run_time":[90],"vote_average":6.8,"created_by":["Davis Entertainment","Columbia Pictures","TSG Entertainment"],"production_companies":[{"name":"Davis Entertainment"},{"name":"Columbia Pictures"},{"name":"TSG Entertainment"}],"cast":["Zachary Levi","Lil Rel Howery","Zooey Deschanel","Benjamin Bottani","Tanya Reynolds"],"backdrop_path":"https://image.tmdb.org/t/p/original/biMJPdS7bGW7HQTQrHvXxMqOqdC.jpg","poster_path":"https://image.tmdb.org/t/p/original/8LV7FJmmuFXA6468yTBIUDsszBc.jpg","certification":"L","genres":["Família","Aventura","Fantasia","Comédia"],"trailer":"XfZh_5gWg_k"},
"337404":{"id":"337404","name":"Cruella","slug":"cruella","original_title":"Cruella","overview":"Na Londres dos anos 70 em meio à revolução do punk rock, Estella, uma garota inteligente e criativa determinada a fazer um nome para si através de seus designs. Ela faz amizade com uma dupla de jovens ladrões e, juntos, constroem uma vida para si nas ruas de Londres. Um dia, o talento de Estella para a moda chama a atenção da Baronesa Von Hellman, uma lenda fashion que é devastadoramente chique e assustadora. Mas o relacionamento delas desencadeia um curso de eventos e revelações que farão com que Estella abrace seu lado rebelde e se torne a Cruella má, elegante e voltada para a vingança.","first_air_date":"2021-05-26","runtime":134,"episode_run_time":[134],"vote_average":8.0,"created_by":["Walt Disney Pictures","Gunn Films","Marc Platt Productions"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Gunn Films"},{"name":"Marc Platt Productions"}],"cast":["Emma Stone","Emma Thompson","Joel Fry","Paul Walter Hauser","John McCrea"],"backdrop_path":"https://image.tmdb.org/t/p/original/huzHIuaWRMDIAB8jIXYAwE7CJzS.jpg","poster_path":"https://image.tmdb.org/t/p/original/rRYNGhcAZlTfIUS7iFoF4H9iDbc.jpg","certification":"12","genres":["Comédia","Crime","Família","Aventura"],"trailer":"rtuGB3nD5y0"},
