"258230":{"id":"258230","name":"Sete Minutos Depois da Meia-Noite","slug":"sete-minutos-depois-da-meia-noite","original_title":"A Monster Calls","overview":"Conor é um garoto de 13 anos de idade, com muitos problemas na vida. Seu pai é muito ausente, a mãe sofre um um câncer em fase terminal, a avó é uma megera, e ele é maltratado na escola pelos colegas. No entanto, todas as noites Conor tem o mesmo sonho, com uma gigantesca árvore que decide contar histórias para ele, em troca de escutar as histórias do garoto. Embora as conversas com a árvore tenham consequências negativas na vida real, elas ajudam Conor a escapar das dificuldades através do mundo da fantasia.","first_air_date":"2016-10-07","runtime":108,"episode_run_time":[108],"vote_average":7.3,"created_by":["River Road Entertainment","Participant","Apaches Films","La Trini","A Monster Calls AIE","Telecinco Cinema","Summit Entertainment","Focus Features"],"production_companies":[{"name":"River Road Entertainment"},{"name":"Participant"},{"name":"Apaches Films"},{"name":"La Trini"},{"name":"A Monster Calls AIE"},{"name":"Telecinco Cinema"},{"name":"Summit Entertainment"},{"name":"Focus Features"}],"cast":["Lewis MacDougall","Sigourney Weaver","Felicity Jones","Toby Kebbell","Ben Moor"],"backdrop_path":"https://image.tmdb.org/t/p/original/mAUfGMmYmsBeKRHlBdaj7YUe1Ow.jpg","poster_path":"https://image.tmdb.org/t/p/original/scxpDGYLwX7Y8e57kZDbE5qvHwF.jpg","certification":"12","genres":["Fantasia","Aventura","Família"],"trailer":"N/A"},
