"947891":{"id":"947891","name":"Meu Eu do Futuro","slug":"meu-eu-do-futuro","original_title":"My Old Ass","overview":"Nesta nova história de amadurecimento, uma viagem à base de cogumelo, no aniversário de 18 anos deixa a livre Elliott (Maisy Stella) cara a cara com seu eu brincalhão de 39 anos (Aubrey Plaza). Quando a eu do futuro de Elliott começa a aconselhar seu eu mais jovem a não se apaixonar, ela tem certeza de que pode fazer isso mesmo sozinha. Isso até ela conhecer o rapaz sobre o qual seu eu mais velho a alertou. Ai Elliott percebe que precisa repensar tudo sobre família, amor e percebe que este está se tornando um verão transformador.","first_air_date":"2024-09-13","runtime":89,"episode_run_time":[89],"vote_average":6.9,"created_by":["Indian Paintbrush","LuckyChap Entertainment"],"production_companies":[{"name":"Indian Paintbrush"},{"name":"LuckyChap Entertainment"}],"cast":["Maisy Stella","Aubrey Plaza","Percy Hynes White","Maddie Ziegler","Kerrice Brooks"],"backdrop_path":"https://image.tmdb.org/t/p/original/iPHsjvbFyGbeCEDC7u8Ib8U1zS6.jpg","poster_path":"https://image.tmdb.org/t/p/original/auYvFnxhWzFxuhVQVSrDw8qkDAS.jpg","certification":"18","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
"845783":{"id":"845783","name":"A Bruxa dos Mortos: Baghead","slug":"a-bruxa-dos-mortos-baghead","original_title":"Baghead","overview":"Após o falecimento de seu pai, Iris (Freya Allan) herda um antigo bar e se depara com um segredo obscuro: o local abriga uma entidade capaz de incorporar os mortos. Tentada a explorar os poderes da criatura e ajudar pessoas desesperadas em troca de dinheiro, Iris mergulha em um terreno perigoso. Ao lado de sua melhor amiga Katie (Ruby Barker), ela agora precisa lutar para manter o controle sobre Baghead e descobrir como destruí-la antes que ela as destrua.","first_air_date":"2023-12-28","runtime":95,"episode_run_time":[95],"vote_average":6.5,"created_by":["The Picture Company","Studio Babelsberg","StudioCanal","Canal+","Tonstudio Hanse Warns"],"production_companies":[{"name":"The Picture Company"},{"name":"Studio Babelsberg"},{"name":"StudioCanal"},{"name":"Canal+"},{"name":"Tonstudio Hanse Warns"}],"cast":["Freya Allan","Jeremy Irvine","Ruby Barker","Peter Mullan","Anne Müller"],"backdrop_path":"https://image.tmdb.org/t/p/original/lVJVLe4EZ1hOKPUWgsZVebCnr0C.jpg","poster_path":"https://image.tmdb.org/t/p/original/hV1duOiPt8o4JxUltlSbYXMJehf.jpg","certification":"14","genres":["Terror"],"trailer":"eceE7b_Hciw"},
