"829557":{"id":"829557","name":"365 Dias: Hoje","slug":"365-dias-hoje","original_title":"365 dni: Ten dzień","overview":"Em 365 Dias: Hoje, após os acontecimentos de 365 Dias, Laura Biel se casa com Don Massimo, o chefe da máfia siciliana que a sequestrou. Sua vida parece um conto de fadas: ela tem um marido amoroso, uma casa linda e um bebê a caminho. Mas Massimo tem muitos inimigos, e eles sabem que a melhor maneira de lhe causar dor é ferir aqueles que ama. Depois de um mal-entendido conjugal, Laura e sua melhor amiga, Olga, fogem da Sicília para a Polônia natal. Mas sem a proteção do marido, Laura é sequestrada por Marcelo \"Nacho\" Matos, filho do chefe da máfia rival, e levada para as Ilhas Canárias pela máfia espanhola. Agora Massimo moverá qualquer montanha para resgatá-la. Mas o que o chefe da máfia siciliana não espera é que Laura começa a ter sentimentos pelo seu raptor, lindo e extremamente perigoso, enquanto é mantida refém.","first_air_date":"2022-04-26","runtime":111,"episode_run_time":[111],"vote_average":5.9,"created_by":["Ekipa","Open Mind Production"],"production_companies":[{"name":"Ekipa"},{"name":"Open Mind Production"}],"cast":["Anna-Maria Sieklucka","Michele Morrone","Simone Susinna","Magdalena Lamparska","Otar Saralidze"],"backdrop_path":"https://image.tmdb.org/t/p/original/zBG5Mg29NH9xxpWMMG7BIvKwYhL.jpg","poster_path":"https://image.tmdb.org/t/p/original/3104lH1U1XfUXo0ZLawnIjXS0NC.jpg","certification":"18","genres":["Romance","Drama"],"trailer":"N/A"},
"278927":{"id":"278927","name":"Mogli: O Menino Lobo","slug":"mogli-o-menino-lobo","original_title":"The Jungle Book","overview":"Mogli é um menino criado por uma família de lobos. Mas Mogli sente que não é mais bem-vindo na floresta quando o temido tigre Shere Khan, que carrega cicatrizes causadas por caçadores, promete eliminar o que ele considera uma ameaça. Forçado a abandonar o único lar que conhece, Mogli embarca em uma cativante jornada de autoconhecimento, guiado pela pantera e mentora Bagheera e pelo alegre urso Baloo. Pelo caminho, Mogli encontra criaturas da selva que não são exatamente bondosas, incluindo Kaa, uma cobra cuja voz sedutora e olhar penetrante hipnotizam o menino-lobo, e Rei Loiue, o nobre de fala mansa que tenta convencer Mogli a contar o segredo da ilusória flor vermelha mortal: o fogo.","first_air_date":"2016-04-07","runtime":106,"episode_run_time":[106],"vote_average":6.9,"created_by":["Walt Disney Pictures","Fairview Entertainment","Moving Picture Company"],"production_companies":[{"name":"Walt Disney Pictures"},{"name":"Fairview Entertainment"},{"name":"Moving Picture Company"}],"cast":["Neel Sethi","Bill Murray","Ben Kingsley","Idris Elba","Scarlett Johansson"],"backdrop_path":"https://image.tmdb.org/t/p/original/8oYykF1Qhrb8fC2qZqD71EzRywg.jpg","poster_path":"https://image.tmdb.org/t/p/original/5qf7bJm1aEtTQ7Ce0uPxMRQ9IAe.jpg","certification":"10","genres":["Família","Aventura","Drama","Fantasia"],"trailer":"upPNjcQXw-s"},
