"489":{"id":"489","name":"Gênio Indomável","slug":"genio-indomavel","original_title":"Good Will Hunting","overview":"Teimoso e sem objetivo, Will Hunting tem um QI de gênio, mas opta por trabalhar como zelador no MIT. Quando ele resolve secretamente problemas de matemática altamente difíceis em nível de pós-graduação, seus talentos são descobertos pelo professor Gerald Lambeau, que decide ajudar o jovem desorientado a atingir seu potencial. Quando Will é preso por atacar um policial, o professor Lambeau faz um acordo para obter clemência se ele fizer terapia por ordem judicial. Por fim, o terapeuta Dr. Sean Maguire ajuda Will a enfrentar os demônios que o impedem de progredir.","first_air_date":"1997-12-05","runtime":126,"episode_run_time":[126],"vote_average":8.2,"created_by":["Lawrence Bender Productions","Be Gentlemen Limited Partnership","Miramax"],"production_companies":[{"name":"Lawrence Bender Productions"},{"name":"Be Gentlemen Limited Partnership"},{"name":"Miramax"}],"cast":["Matt Damon","Robin Williams","Ben Affleck","Stellan Skarsgård","Minnie Driver"],"backdrop_path":"https://image.tmdb.org/t/p/original/bpV8wn48s82au37QyUJ51S7X2Vf.jpg","poster_path":"https://image.tmdb.org/t/p/original/zY6kY3nOn4mi7VQdn6tCCj1eBZe.jpg","certification":"14","genres":["Drama"],"trailer":"N/A"},
