"106646":{"id":"106646","name":"O Lobo de Wall Street","slug":"o-lobo-de-wall-street","original_title":"The Wolf of Wall Street","overview":"Durante seis meses, Jordan Belfort trabalhou duro em uma corretora de Wall Street, seguindo os ensinamentos de seu mentor Mark Hanna. Quando finalmente consegue ser contratado como corretor da firma, acontece o Black Monday, que faz com que as bolsas de vários países caiam repentinamente. Sem emprego e bastante ambicioso, ele acaba trabalhando para uma empresa de fundo de quintal que lida com papéis de baixo valor, que não estão na bolsa de valores. É lá que Belfort tem a idéia de montar uma empresa focada neste tipo de negócio, cujas vendas são de valores mais baixos mas, em compensação, o retorno para o corretor é bem mais vantajoso. Ao lado de Donnie e outros amigos dos velhos tempos, ele cria a Stratton Oakmont, uma empresa que faz com que todos enriqueçam rapidamente e, também, levem uma vida dedicada ao prazer.","first_air_date":"2013-12-25","runtime":180,"episode_run_time":[180],"vote_average":8.0,"created_by":["Red Granite Pictures","Appian Way","Sikelia Productions","EMJAG Productions"],"production_companies":[{"name":"Red Granite Pictures"},{"name":"Appian Way"},{"name":"Sikelia Productions"},{"name":"EMJAG Productions"}],"cast":["Leonardo DiCaprio","Jonah Hill","Margot Robbie","Matthew McConaughey","Kyle Chandler"],"backdrop_path":"https://image.tmdb.org/t/p/original/63y4XSVTZ7mRzAzkqwi3o0ajDZZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/esJTXTdj4JZDyP5LUI1Fq3kyNda.jpg","certification":"18","genres":["Crime","Drama","Comédia"],"trailer":"PoSCUsNQVtw"},
"49051":{"id":"49051","name":"O Hobbit: Uma Jornada Inesperada","slug":"o-hobbit-uma-jornada-inesperada","original_title":"The Hobbit: An Unexpected Journey","overview":"Como a maioria dos hobbits, Bilbo Bolseiro leva uma vida tranquila até o dia em que recebe uma missão do mago Gandalf. Acompanhado por um grupo de anões, ele parte numa jornada até a Montanha Solitária para libertar o Reino de Erebor do dragão Smaug.","first_air_date":"2012-12-12","runtime":182,"episode_run_time":[182],"vote_average":7.4,"created_by":["New Line Cinema","Metro-Goldwyn-Mayer","WingNut Films","Warner Bros. Pictures","Warner Bros. Entertainment"],"production_companies":[{"name":"New Line Cinema"},{"name":"Metro-Goldwyn-Mayer"},{"name":"WingNut Films"},{"name":"Warner Bros. Pictures"},{"name":"Warner Bros. Entertainment"}],"cast":["Martin Freeman","Ian McKellen","Richard Armitage","James Nesbitt","Ken Stott"],"backdrop_path":"https://image.tmdb.org/t/p/original/xyXmtuvsoM5J3yNad0nvcetpBdY.jpg","poster_path":"https://image.tmdb.org/t/p/original/ghSOjNRLpXjp9PB22CnGRuZgXJW.jpg","certification":"12","genres":["Aventura","Fantasia","Ação"],"trailer":"xxd5a8hRWls"},
"8839":{"id":"8839","name":"Gasparzinho, o Fantasminha Camarada","slug":"gasparzinho-o-fantasminha-camarada","original_title":"Casper","overview":"O \"terapeuta de fantasmas\" Dr. James Harvey e sua filha Kat chegam à decadente e velha Mansão Whipstaff. Sua gananciosa proprietária, Carrigan Crittendon, alugou-a para que o Dr. Harvey exorcizasse as aparições da casa: um amistoso mas solitário fantasma chamado Gasparzinho, que busca apenas um amigo e seus tios ultrajantes Stretch, Stinkie e Fatso (o Trio Calafrio). Se o plano funcionar, ela e Dibs, seu sócio, vão pôr as mãos no fabuloso tesouro da mansão. Enquanto isso, Gasparzinho encontra um espírito idêntico em Kat, mas o Trio Calafrio não vai tolerar sentimentalismos em sua casa.","first_air_date":"1995-05-26","runtime":101,"episode_run_time":[101],"vote_average":6.3,"created_by":["The Harvey Entertainment Company","Universal Pictures","Amblin Entertainment"],"production_companies":[{"name":"The Harvey Entertainment Company"},{"name":"Universal Pictures"},{"name":"Amblin Entertainment"}],"cast":["Malachi Pearson","Christina Ricci","Bill Pullman","Cathy Moriarty","Eric Idle"],"backdrop_path":"https://image.tmdb.org/t/p/original/5pk9N6UzeoNMXoBF7l0XKWWg2hv.jpg","poster_path":"https://image.tmdb.org/t/p/original/s89ACIwVDsESNyWbpe495Iigq8e.jpg","certification":"L","genres":["Fantasia","Comédia","Família"],"trailer":"N/A"},
"4922":{"id":"4922","name":"O Curioso Caso de Benjamin Button","slug":"o-curioso-caso-de-benjamin-button","original_title":"The Curious Case of Benjamin Button","overview":"Benjamin Button é um homem que nasce idoso e rejuvenesce à medida que o tempo passa. Doze anos depois de seu nascimento, ele conhece Daisy, uma criança que entra e sai de sua vida enquanto cresce para ser dançarina. Embora tenha todos os tipos de aventuras incomuns, sua relação com Daisy o faz acreditar que os dois se encontrarão no momento certo da vida.","first_air_date":"2008-12-25","runtime":166,"episode_run_time":[166],"vote_average":7.6,"created_by":["Paramount Pictures","Warner Bros. Pictures","The Kennedy/Marshall Company"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Warner Bros. Pictures"},{"name":"The Kennedy/Marshall Company"}],"cast":["Brad Pitt","Cate Blanchett","Taraji P. Henson","Julia Ormond","Jason Flemyng"],"backdrop_path":"https://image.tmdb.org/t/p/original/2fswjyrY3GEzeoVn6mF8pNeNcgf.jpg","poster_path":"https://image.tmdb.org/t/p/original/84YkduLeFcYgqDBGcJ012fxdYqF.jpg","certification":"12","genres":["Drama","Fantasia","Romance"],"trailer":"p8ucIL2tLLo"},
