"639933":{"id":"639933","name":"O Homem do Norte","slug":"o-homem-do-norte","original_title":"The Northman","overview":"No ano de 914, o príncipe Amleth testemunha o brutal assassinato de seu pai, Horvendill, por seu tio, Fjölnir, que também sequestra sua mãe. O menino foge, mas jura que voltará para vingar seu pai, salvar sua mãe e matar seu tio. Vinte anos depois, Amleth, agora um Viking, conhece uma vidente que o lembra que é chegada a hora de cumprir sua promessa.","first_air_date":"2022-04-07","runtime":137,"episode_run_time":[137],"vote_average":7.0,"created_by":["Focus Features","New Regency Pictures","Regency Enterprises","Square Peg"],"production_companies":[{"name":"Focus Features"},{"name":"New Regency Pictures"},{"name":"Regency Enterprises"},{"name":"Square Peg"}],"cast":["Alexander Skarsgård","Nicole Kidman","Claes Bang","Ethan Hawke","Anya Taylor-Joy"],"backdrop_path":"https://image.tmdb.org/t/p/original/cqnVuxXe6vA7wfNWubak3x36DKJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/vJfLNvOMK1Ek7OvpKgBDSqH2kN1.jpg","certification":"18","genres":["Ação","Aventura","Fantasia"],"trailer":"9SWnR2L6n0U"},
