"346648":{"id":"346648","name":"As Aventuras de Paddington 2","slug":"as-aventuras-de-paddington-2","original_title":"Paddington 2","overview":"Após ser adotado pela família Brown, Paddington ganhou muita popularidade na comunidade de Windsor Gardens. No aniversario de 100 anos de sua tia Lucy, esse simpático ursinho sai em busca do presente perfeito e acaba encontrando um livro único na loja de antiguidades do senhor Gruber. Paddington se submete a uma série de trabalhos bizarros para poder comprá-lo, e quando o livro é roubado, ele e sua família farão de tudo para encontrar o ladrão.","first_air_date":"2017-11-09","runtime":103,"episode_run_time":[103],"vote_average":7.5,"created_by":["StudioCanal","Heyday Films","Anton Capital Entertainment"],"production_companies":[{"name":"StudioCanal"},{"name":"Heyday Films"},{"name":"Anton Capital Entertainment"}],"cast":["Ben Whishaw","Sally Hawkins","Hugh Bonneville","Hugh Grant","Madeleine Harris"],"backdrop_path":"https://image.tmdb.org/t/p/original/AmoYMCH3rz7r4b7QMZfcOprV7Uh.jpg","poster_path":"https://image.tmdb.org/t/p/original/bVAplALQBfKNRrAdOWol6T49Yw6.jpg","certification":"L","genres":["Aventura","Comédia","Família"],"trailer":"N/A"},
