"56292":{"id":"56292","name":"Missão: Impossível - Protocolo Fantasma","slug":"missao-impossivel-protocolo-fantasma","original_title":"Mission: Impossible - Ghost Protocol","overview":"Ethan Hunt e sua equipe correm contra o tempo para localizar um perigoso terrorista chamado Hendricks, que obteve acesso aos códigos de lançamento nuclear russo e está planejando um ataque aos Estados Unidos. Uma tentativa de detê-lo termina em uma explosão que causa grande destruição no Kremlin e o IMF é implicado no bombardeio, forçando o Presidente a rejeitá-los. Sem a ajuda do governo, Ethan e sua equipe perseguem Hendricks em todo o mundo, embora ainda possa ser tarde demais para impedir um desastre.","first_air_date":"2011-12-07","runtime":133,"episode_run_time":[133],"vote_average":7.1,"created_by":["Paramount Pictures","Bad Robot","TC Productions","Skydance Media"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Bad Robot"},{"name":"TC Productions"},{"name":"Skydance Media"}],"cast":["Tom Cruise","Paula Patton","Simon Pegg","Jeremy Renner","Michael Nyqvist"],"backdrop_path":"https://image.tmdb.org/t/p/original/ih4lZkUpmSE7AP3maymiO72xJ1z.jpg","poster_path":"https://image.tmdb.org/t/p/original/19vTKySZasegBjQFfdawcY0HBPc.jpg","certification":"14","genres":["Ação","Thriller","Aventura"],"trailer":"N/A"},
"293167":{"id":"293167","name":"Kong: A Ilha da Caveira","slug":"kong-a-ilha-da-caveira","original_title":"Kong: Skull Island","overview":"Um ex-militar viaja com um grupo de desbravadores até a mítica Ilha da Caveira, onde seu irmão desapareceu enquanto procurava o Titan, soro que teria o poder de curar todas as doenças. Além de resgatar o irmão, o homem irá enfrentar as criaturas que habitam o local. A equipe de exploradores se aventura nas profundezas da ilha desconhecida no Pacífico, que é tão bonita quanto traiçoeira, sem saber que estão atravessando para o domínio do mítico Kong.","first_air_date":"2017-03-08","runtime":118,"episode_run_time":[118],"vote_average":6.5,"created_by":["Legendary Pictures","Tencent Pictures"],"production_companies":[{"name":"Legendary Pictures"},{"name":"Tencent Pictures"}],"cast":["Tom Hiddleston","Samuel L. Jackson","John Goodman","Brie Larson","景甜"],"backdrop_path":"https://image.tmdb.org/t/p/original/jks6QgJjsaDC5iT6bxLsSS0eo6L.jpg","poster_path":"https://image.tmdb.org/t/p/original/vhSXxrwfkFDiFRR8S6BSBQuCeQT.jpg","certification":"12","genres":["Ação","Aventura","Fantasia"],"trailer":"ksUvtsN8KRI"},
