"630":{"id":"630","name":"O Mágico de Oz","slug":"o-magico-de-oz","original_title":"The Wizard of Oz","overview":"Dorothy e seu cachorro Totó são levados para a terra mágica de Oz quando um ciclone passa pela fazenda de seus avós no Kansas. Eles viajam em direção à Cidade Esmeralda para encontrar o Mago Oz e no caminho encontram um Espantalho, que precisa de um cérebro, um Homem de Lata sem um coração e um Leão Covarde que quer coragem. O Mago pede ao grupo que tragam a vassoura da Bruxa Malvada do Oeste a fim de ganharem sua ajuda.","first_air_date":"1939-08-15","runtime":101,"episode_run_time":[101],"vote_average":7.6,"created_by":["Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"}],"cast":["Judy Garland","Frank Morgan","Ray Bolger","Bert Lahr","Jack Haley"],"backdrop_path":"https://image.tmdb.org/t/p/original/qCU097AXMPAsmpVK4j9kzMTxt2d.jpg","poster_path":"https://image.tmdb.org/t/p/original/jKNm6l8YGGn9t99pf8L4F9UEfbH.jpg","certification":"L","genres":["Aventura","Fantasia","Família"],"trailer":"N/A"},
"22538":{"id":"22538","name":"Scott Pilgrim Contra o Mundo","slug":"scott-pilgrim-contra-o-mundo","original_title":"Scott Pilgrim vs. the World","overview":"Scott Pilgrim (Michael Cera) tem 23 anos, integra uma banda de colégio, vive trocando de emprego e tem um namoro firme. Sua vida está maravilhosa, até conhecer Ramona V. Flowers (Mary Elizabeth Winestead). Ele logo se apaixona perdidamente por ela, só que não será fácil conquistar seu amor. Para tanto ele precisa enfrentar os sete ex-namorados dela, que estão dispostos a tudo para impedir sua felicidade com outra pessoa.","first_air_date":"2010-08-12","runtime":113,"episode_run_time":[113],"vote_average":7.5,"created_by":["Marc Platt Productions","Big Talk Studios","Closed on Mondays Entertainment","dentsu"],"production_companies":[{"name":"Marc Platt Productions"},{"name":"Big Talk Studios"},{"name":"Closed on Mondays Entertainment"},{"name":"dentsu"}],"cast":["Michael Cera","Mary Elizabeth Winstead","Ellen Wong","Kieran Culkin","Alison Pill"],"backdrop_path":"https://image.tmdb.org/t/p/original/7W9xm2YTq54rfLFimIniMrywShv.jpg","poster_path":"https://image.tmdb.org/t/p/original/l7EGWWmBiXsL7L2yBV69shGUclH.jpg","certification":"12","genres":["Ação","Comédia","Romance"],"trailer":"N/A"},
