"198184":{"id":"198184","name":"Chappie","slug":"chappie","original_title":"Chappie","overview":"Em um futuro próximo, a África do Sul decidiu substituir os seus policiais humanos por robôs dotados de inteligência artificial. O criador , o cientista Deon, sonha em embutir emoções nos robôs. Um dia, ele rouba um modelo defeituoso e faz experiências nele, até conseguir criar Chappie, um robô capaz de pensar e aprender por conta própria. Mas Chappie é roubado por ladrões que precisam da ajuda para um assalto a banco. Quando Vincent, um engenheiro rival de Deon, decide sabotar as experiências do colega de trabalho, a segurança do país e o futuro de Chappie correm riscos.","first_air_date":"2015-03-04","runtime":120,"episode_run_time":[120],"vote_average":6.8,"created_by":["Columbia Pictures","MRC","LStar Capital","Genre Films"],"production_companies":[{"name":"Columbia Pictures"},{"name":"MRC"},{"name":"LStar Capital"},{"name":"Genre Films"}],"cast":["Sharlto Copley","Dev Patel","Hugh Jackman","Ninja","Yo-Landi Visser"],"backdrop_path":"https://image.tmdb.org/t/p/original/3pKIcv6KhUE35jsKnv3MylQ3OT2.jpg","poster_path":"https://image.tmdb.org/t/p/original/cg93jYwHiDVkesAkllPfeiO6brm.jpg","certification":"16","genres":["Crime","Ação","Ficção científica"],"trailer":"eXIGpyia3Kk"},
