"9602":{"id":"9602","name":"Um Príncipe em Nova York","slug":"um-principe-em-nova-york","original_title":"Coming to America","overview":"Akeem (Eddie Murphy), o príncipe herdeiro de Zamunda, África, se rebela contra o casamento arranjando por seu pai, o rei Jaffe Joffer (James Earl Jones), que concorda que o filho viaje pelo mundo por 40 dias. Assim, Akeem vai para Nova York, se passando por um pobre estudante para encontrar uma noiva que o ame pelo o que ele é, não por sua posição. Vai trabalhar em uma lanchonete e sente-se atraído por Lisa (Shari Hadley), a filha do seu patrão, Cleo McDowell (John Amos), que é interesseiro e atrapalha o romance, pois quer um bom partido para a filha, sem imaginar quem é na verdade seu funcionário. Akeem viajou com Semmi (Arsenio Hall), seu melhor amigo, que não gosta de se passar por pobre e faz gastos e toma atitudes que podem revelar a identidade de Akeem.","first_air_date":"1988-06-29","runtime":116,"episode_run_time":[116],"vote_average":6.9,"created_by":["Eddie Murphy Productions","Paramount Pictures"],"production_companies":[{"name":"Eddie Murphy Productions"},{"name":"Paramount Pictures"}],"cast":["Eddie Murphy","Arsenio Hall","Shari Headley","John Amos","James Earl Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/hP4PMoQfaofHbLDPIAXrirR7wSF.jpg","poster_path":"https://image.tmdb.org/t/p/original/i4PD8EddMJK23gQbANYdCwQeJaE.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
