"9532":{"id":"9532","name":"Premonição","slug":"premonicao","original_title":"Final Destination","overview":"Pouco antes de decolar no vôo 180 para Paris, Alex experimenta a angustiante visão do avião transformando-se numa bola de fogo gigante em pleno vôo. Em pânico, o estudante é retirado da aeronave com uma professora e alguns colegas de classe. Irritado e decepcionado, o grupo assiste seu vôo partir. É quando o inimaginável acontece, o avião explode matando todo mundo a bordo! Confuso entre a idéia de Alex ter salvo a todos e a possibilidade de ele ter provocado o acidente, o grupo não sabe como reagir. Para Alex, porém, o fato de ter escapado da tragédia não traz alívio, pois presságios terríveis continuam a perturbá-lo. Neles Alex vê, um a um, seus amigos morrerem. Então percebe que, ao saírem do avião, eles desafiaram a ordem natural das coisas e agora terão de acertar suas contas com a própria Morte.","first_air_date":"2000-03-17","runtime":98,"episode_run_time":[98],"vote_average":6.6,"created_by":["Hard Eight Pictures","New Line Cinema","Zide-Perry Productions"],"production_companies":[{"name":"Hard Eight Pictures"},{"name":"New Line Cinema"},{"name":"Zide-Perry Productions"}],"cast":["Devon Sawa","Ali Larter","Kerr Smith","Kristen Cloke","Seann William Scott"],"backdrop_path":"https://image.tmdb.org/t/p/original/6KDLAU9OnA0FhXP1av8jqavCGG9.jpg","poster_path":"https://image.tmdb.org/t/p/original/b5ERChzoI1aLzeYdmwWUtutwm8c.jpg","certification":"14","genres":["Terror"],"trailer":"yLnvUdKGIXY"},
