"402900":{"id":"402900","name":"Oito Mulheres e um Segredo","slug":"oito-mulheres-e-um-segredo","original_title":"Ocean's Eight","overview":"Cinco anos, oito meses, 12 dias... em contagem regressiva. Este foi o tempo que Debbie Ocean levou para preparar o maior assalto da sua vida. Ela sabe que precisará de uma equipe com as melhores do métier, a começar pela sua parceira de crimes Lou Miller. Juntas, elas recrutam um grupo de especialistas: a joalheira Amita, a vigarista Constance, a especialista em receptação Tammy, a hacker Nine Ball e a estilista Rose. O alvo é US$ 150 milhões de dólares em diamantes... diamantes que estarão no pescoço da atriz mundialmente famosa Daphne Kluger, na grande atração no evento do ano, o Met Gala. O plano é sólido como uma rocha, mas tudo precisará ser perfeito para a equipe conseguir entrar e escapar com os diamantes. Tudo absolutamente à vista.","first_air_date":"2018-06-07","runtime":111,"episode_run_time":[111],"vote_average":7.0,"created_by":["Village Roadshow Pictures","Warner Bros. Pictures","Larger Than Life Productions","Rahway Road Productions"],"production_companies":[{"name":"Village Roadshow Pictures"},{"name":"Warner Bros. Pictures"},{"name":"Larger Than Life Productions"},{"name":"Rahway Road Productions"}],"cast":["Sandra Bullock","Cate Blanchett","Sarah Paulson","Anne Hathaway","Awkwafina"],"backdrop_path":"https://image.tmdb.org/t/p/original/scQf03Fm3jeyv4FH04qvi4fp4wh.jpg","poster_path":"https://image.tmdb.org/t/p/original/mymTjvZeg9hkSSofg78nH0GOtLS.jpg","certification":"14","genres":["Crime","Comédia","Ação"],"trailer":"N/A"},
