"289":{"id":"289","name":"Casablanca","slug":"casablanca","original_title":"Casablanca","overview":"Durante a Segunda Guerra Mundial, muitos fugitivos tentavam escapar dos nazistas por uma rota que passava pela cidade de Casablanca. O exilado americano Rick Blaine encontrou refúgio na cidade, dirigindo uma das principais casas noturnas da região. Clandestinamente, tentando despistar o Capitão Renault, ele ajuda refugiados, possibilitando que eles fujam para os Estados Unidos. Quando um casal pede sua ajuda para deixar o país, ele reencontra uma grande paixão do passado, a bela Ilsa. Este amor vai encontrar uma nova vida e eles vão lutar para fugir juntos.","first_air_date":"1943-01-15","runtime":102,"episode_run_time":[102],"vote_average":8.2,"created_by":["Warner Bros. Pictures"],"production_companies":[{"name":"Warner Bros. Pictures"}],"cast":["Humphrey Bogart","Ingrid Bergman","Paul Henreid","Claude Rains","Conrad Veidt"],"backdrop_path":"https://image.tmdb.org/t/p/original/rrsG3xYrWifoduZtsIZ4ntoDfBY.jpg","poster_path":"https://image.tmdb.org/t/p/original/5K7cOHoay2mZusSLezBOY0Qxh8a.jpg","certification":"12","genres":["Drama","Romance"],"trailer":"N/A"},
