"5689":{"id":"5689","name":"A Lagoa Azul","slug":"a-lagoa-azul","original_title":"The Blue Lagoon","overview":"Emmeline e Richard, duas crianças, juntamente com Paddy Button, um velho marinheiro, são os únicos sobreviventes de um naufrágio numa época em que navegar era a única forma de viajar. Após ficarem à deriva por várias horas eles vão parar em uma ilha tropical que é um verdadeiro paraíso. O lugar não oferece perigo, pois não há animais selvagens, mas após algum tempo Paddy morre. Com o tempo Emmeline e Richard se tornam adolescentes e vivem em uma cabana que eles mesmos construíram. Neste período novas emoções influenciam o relacionamento deles, os dois descobrem o amor e logo Emmeline está grávida. Na noite em que o filho deles nasce Richard descobre a origem dos tambores que eles ouvem de vez em quando no \"lado proibido\" da ilha.","first_air_date":"1980-07-05","runtime":105,"episode_run_time":[105],"vote_average":6.2,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Brooke Shields","Christopher Atkins","Leo McKern","William Daniels","Jeffrey Kleiser"],"backdrop_path":"https://image.tmdb.org/t/p/original/jKT2wVlX4wjacDqu3Y2hhPOAao3.jpg","poster_path":"https://image.tmdb.org/t/p/original/44NpOB3zKwSKzu6mEDQY235rRxP.jpg","certification":"N/A","genres":["Romance","Aventura"],"trailer":"N/A"},
"193756":{"id":"193756","name":"O Grande Herói","slug":"o-grande-heroi","original_title":"Lone Survivor","overview":"Marcus Luttrell, oficial da marinha norte-americana , é enviado ao Afeganistão em busca de um homem de confiança de Osama Bin Laden. Quando ele se depara com um homem idoso e três crianças, ele recebe ordens para matar os quatro, mas Marcus não tem coragem de fazê-lo. O paradeiro dos americanos é descoberto e logo toda a equipe é atacada por 250 homens armados, enviados pela Al Qaeda.","first_air_date":"2013-12-24","runtime":121,"episode_run_time":[121],"vote_average":7.4,"created_by":["EFO Films","Envision Entertainment","Film 44","Herrick Entertainment","Leverage Entertainment","Spikings Entertainment","Single Berry","Closest to the Hole Productions"],"production_companies":[{"name":"EFO Films"},{"name":"Envision Entertainment"},{"name":"Film 44"},{"name":"Herrick Entertainment"},{"name":"Leverage Entertainment"},{"name":"Spikings Entertainment"},{"name":"Single Berry"},{"name":"Closest to the Hole Productions"}],"cast":["Mark Wahlberg","Taylor Kitsch","Emile Hirsch","Ben Foster","Eric Bana"],"backdrop_path":"https://image.tmdb.org/t/p/original/g6QPI70Kzt91Q0lGyLfsVqZAwlJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/9Xcir0rOyYydPhGRYgG0Ctt1sqf.jpg","certification":"16","genres":["Guerra","Ação","Drama"],"trailer":"N/A"},
"393":{"id":"393","name":"Kill Bill: Volume 2","slug":"kill-bill-volume-2","original_title":"Kill Bill: Vol. 2","overview":"Após ser traída por Bill e seu antigo grupo, a Noiva assassina fica à beira da morte por 4 anos. Após despertar do coma, ela vai atrás de cada um dos seus antigos companheiros para matá-los. Na segunda parte dessa busca por vingança, a noiva vai continuar sua procura por Bill, atacando os últimos dois sobreviventes do grupo: Budd e Elle Driver . O confronto com seu antigo mestre, e mandante da sua morte, vai revelar novas surpresas para a assassina.","first_air_date":"2004-04-16","runtime":138,"episode_run_time":[138],"vote_average":7.9,"created_by":["Super Cool ManChu","Miramax","A Band Apart"],"production_companies":[{"name":"Super Cool ManChu"},{"name":"Miramax"},{"name":"A Band Apart"}],"cast":["Uma Thurman","David Carradine","Daryl Hannah","Michael Madsen","劉家輝"],"backdrop_path":"https://image.tmdb.org/t/p/original/pgG6tzJzC8mjGqhaT8IWwEk00xf.jpg","poster_path":"https://image.tmdb.org/t/p/original/e4yFdkNBjVX0D09UksbDEBdmynl.jpg","certification":"16","genres":["Ação","Crime","Thriller"],"trailer":"N/A"},
"664":{"id":"664","name":"Twister","slug":"twister","original_title":"Twister","overview":"Em Oklahoma está se anunciando uma tempestade que não acontece há décadas e dois grupos de cientistas rivais planejam entrar para a história colocando sensores no tornado, para que estas informações possam ir até um computador e, assim, seja possível prever sua chegada com maior antecedência. Mas para colocar os sensores, é necessário ficar o mais próximo possível do tornado e torcer para que os sensores sejam sugados pela tempestade. Em uma das equipes está uma jovem (Helen Hunt) obcecada por tal idéia, pois em 1969 ela viu o pai ser sugado por uma tempestade e atualmente ela planeja conseguir seu intento ou morrer tentando.","first_air_date":"1996-05-10","runtime":113,"episode_run_time":[113],"vote_average":6.5,"created_by":["Warner Bros. Pictures","Universal Pictures","Amblin Entertainment"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Universal Pictures"},{"name":"Amblin Entertainment"}],"cast":["Helen Hunt","Bill Paxton","Jami Gertz","Cary Elwes","Lois Smith"],"backdrop_path":"https://image.tmdb.org/t/p/original/5oCAo7LFj2x0yByfi5JYirGnK8I.jpg","poster_path":"https://image.tmdb.org/t/p/original/7QXT40RNaD0vac198G3O0U45m3y.jpg","certification":"L","genres":["Ação","Aventura","Drama"],"trailer":"N/A"},
