"534":{"id":"534","name":"O Exterminador do Futuro: A Salvação","slug":"o-exterminador-do-futuro-a-salvacao","original_title":"Terminator Salvation","overview":"Em 2018, após o apocalipse que colocou em confronto homens e robôs, John Connor tornou-se o líder da resistência humana contra a Skynet e o seu exército de Exterminadores. Mas a sua visão do mundo é posta em crise pelo aparecimento de Marcus Wright, um estranho que só se lembra de estar no corredor da morte. Connor tem de descobrir se Marcus foi enviado do futuro ou se é um sobrevivente do passado. Enquanto a Skynet prepara o ataque final, Connor e Marcus embarcam numa odisseia que os levará ao coração das operações da Skynet. Aí descobrirão o terrível segredo por detrás do plano de aniquilação de toda a humanidade...","first_air_date":"2009-05-20","runtime":115,"episode_run_time":[115],"vote_average":6.1,"created_by":["The Halcyon Company","Moritz Borman Productions","Wonderland Sound and Vision","Lin Pictures","Mandate International","T Asset Acquisition Company"],"production_companies":[{"name":"The Halcyon Company"},{"name":"Moritz Borman Productions"},{"name":"Wonderland Sound and Vision"},{"name":"Lin Pictures"},{"name":"Mandate International"},{"name":"T Asset Acquisition Company"}],"cast":["Christian Bale","Sam Worthington","Moon Bloodgood","Helena Bonham Carter","Anton Yelchin"],"backdrop_path":"https://image.tmdb.org/t/p/original/m9yHpYz4GcEtmHJW4rvQIrF891h.jpg","poster_path":"https://image.tmdb.org/t/p/original/7MpR3A0H0R2Uaatms9BNViKDQlV.jpg","certification":"14","genres":["Ação","Ficção científica","Thriller"],"trailer":"N/A"},
