"18239":{"id":"18239","name":"A Saga Crepúsculo: Lua Nova","slug":"a-saga-crepusculo-lua-nova","original_title":"The Twilight Saga: New Moon","overview":"Logo após Bella Swan completar 18 anos, Edward Cullen decide deixá-la para trás em um esforço para protegê-la após um ataque que quase tirou sua vida. Com uma tristeza inconsolável, Bella descobre que ela pode chamar a imagem de Edward sempre que se coloca em perigo e seu desejo em estar com ele a leva a assumir riscos cada vez maiores. Com a ajuda de Jacob Black, seu amigo de infância e um membro da misteriosa tripo Quileute, o coração de Bella vai gradualmente descongelando, enquanto Jacob esconde seu próprio segredo sobrenatural. Ao receber a notícia de que seu amado decide acabar com a própria vida, Bella parte para impedi-lo, sem imaginar que um perigo ainda maior a aguarda.","first_air_date":"2009-11-18","runtime":131,"episode_run_time":[131],"vote_average":6.0,"created_by":["Summit Entertainment","Temple Hill Entertainment","Maverick Films","Imprint Entertainment","Sunswept Entertainment"],"production_companies":[{"name":"Summit Entertainment"},{"name":"Temple Hill Entertainment"},{"name":"Maverick Films"},{"name":"Imprint Entertainment"},{"name":"Sunswept Entertainment"}],"cast":["Kristen Stewart","Robert Pattinson","Taylor Lautner","Dakota Fanning","Michael Sheen"],"backdrop_path":"https://image.tmdb.org/t/p/original/1E7kqUJghDRSgYkxDXAyoaVqQ96.jpg","poster_path":"https://image.tmdb.org/t/p/original/gF0TjnaoKqsYaSni1YN1snQ8q4z.jpg","certification":"12","genres":["Aventura","Fantasia","Drama","Romance"],"trailer":"N/A"},
