"9802":{"id":"9802","name":"A Rocha","slug":"a-rocha","original_title":"The Rock","overview":"Um general, herói na Guerra do Vietnã, e seus comandados se apoderam de poderosas armas químicas e se instalam na prisão de Alcatraz, com 81 reféns. De lá eles ameaçam disparar as armas sobre São Francisco se 100 milhões de dólares não forem pagos, sendo que grande parte desta quantia será para doar às famílias de soldados americanos que morreram em missões secretas e nunca foram reconhecidos pela pátria. Para combatê-los, um grupo de elite é mandado para a ilha e entre eles está um jovem especialista em armas bioquímicas e o único homem que escapou do presídio, só que agora ele tem de entrar e, se possível, completar sua missão e sair vivo.","first_air_date":"1996-06-07","runtime":137,"episode_run_time":[137],"vote_average":7.1,"created_by":["Don Simpson/Jerry Bruckheimer Films","Hollywood Pictures"],"production_companies":[{"name":"Don Simpson/Jerry Bruckheimer Films"},{"name":"Hollywood Pictures"}],"cast":["Sean Connery","Nicolas Cage","Ed Harris","John Spencer","David Morse"],"backdrop_path":"https://image.tmdb.org/t/p/original/qDVdTL1KqGmGLGsy7UPA3vksku7.jpg","poster_path":"https://image.tmdb.org/t/p/original/juqEMUcEZDNMo5AowLr0r4NwSSN.jpg","certification":"16","genres":["Ação","Aventura","Thriller"],"trailer":"N/A"},
