"539":{"id":"539","name":"Psicose","slug":"psicose","original_title":"Psycho","overview":"Marion Crane é uma secretária que rouba 40 mil dólares da imobiliária onde trabalha para se casar e começar uma nova vida. Durante a fuga à carro, ela enfrenta uma forte tempestade, erra o caminho e chega em um velho hotel. O estabelecimento é administrado por um sujeito atencioso chamado Norman Bates, que nutre um forte respeito e temor por sua mãe. Marion decide passar a noite no local, sem saber o perigo que a cerca.","first_air_date":"1960-06-22","runtime":109,"episode_run_time":[109],"vote_average":8.4,"created_by":["Shamley Productions"],"production_companies":[{"name":"Shamley Productions"}],"cast":["Anthony Perkins","Janet Leigh","Vera Miles","John Gavin","Martin Balsam"],"backdrop_path":"https://image.tmdb.org/t/p/original/uif5fUshJrXyyDzfpzp1DLw3N0S.jpg","poster_path":"https://image.tmdb.org/t/p/original/oC2iYT2on8c2iZnehah1l6AWqGu.jpg","certification":"14","genres":["Terror","Thriller","Mistério"],"trailer":"N/A"},
"650":{"id":"650","name":"Os Donos da Rua","slug":"os-donos-da-rua","original_title":"Boyz n the Hood","overview":"Em 1984, no South Central, bairro de maioria negra de Los Angeles, Reva Devereaux (Angela Bassett), mãe de Tre Styles (Cuba Gooding Jr.), conclui que não tem condições de criar o filho rebelde, mas inteligente. Reva decide entregá-lo aos cuidados do pai, Furious Styles (Laurence Fishburne), que passa ao filho valores éticos e morais em uma região marcada pelo pobreza e violência. Após sete anos Tre faz dois grandes amigos: Ricky Baker (Morris Chestnut) e Doughboy (Ice Cube), mas cada um dos três tem objetivos bem distintos na vida.","first_air_date":"1991-07-12","runtime":112,"episode_run_time":[112],"vote_average":7.6,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Cuba Gooding Jr.","Laurence Fishburne","Ice Cube","Morris Chestnut","Angela Bassett"],"backdrop_path":"https://image.tmdb.org/t/p/original/w9Buzxn7RjbttP2xm9leMfMdyCP.jpg","poster_path":"https://image.tmdb.org/t/p/original/rGcu4OVFf3r1oXwlafar7eyG9Tu.jpg","certification":"14","genres":["Crime","Drama"],"trailer":"N/A"},
"406563":{"id":"406563","name":"Sobrenatural: A Última Chave","slug":"sobrenatural-a-ultima-chave","original_title":"Insidious: The Last Key","overview":"A Doutora Elise Rainier é chamada para resolver o caso de uma assombração no Novo México, localizada justamente na casa em que ela passou a infância. Enquanto tenta resolver o caso do morador de sua antiga casa, ela será obrigada a confrontar vários fantasmas e demônios de sua infância, alguns literais. Ao lado de Specs e Tucker, Elise se depara com seu caso mais pessoal.","first_air_date":"2018-01-03","runtime":100,"episode_run_time":[100],"vote_average":6.3,"created_by":["Stage 6 Films","Blumhouse Productions","Universal Pictures","Oren Peli Productions"],"production_companies":[{"name":"Stage 6 Films"},{"name":"Blumhouse Productions"},{"name":"Universal Pictures"},{"name":"Oren Peli Productions"}],"cast":["Lin Shaye","Leigh Whannell","Angus Sampson","Kirk Acevedo","Caitlin Gerard"],"backdrop_path":"https://image.tmdb.org/t/p/original/PwI3EfasE9fVuXsmMu9ffJh0Re.jpg","poster_path":"https://image.tmdb.org/t/p/original/v3RYZGwImjBUF18RV57J5QuOa31.jpg","certification":"14","genres":["Terror","Thriller"],"trailer":"N/A"},
"1422877":{"id":"1422877","name":"Miss Itália Não Pode Morrer","slug":"miss-italia-nao-pode-morrer","original_title":"Miss Italia non deve morire","overview":"O controverso concurso de beleza Miss Itália ganha um documentário no qual a patrona e diretora do programa Patrizia Mirigliani tenta salvá-lo após diferentes polêmicas e mudanças sociais e culturais. Em Miss Itália Não Pode Morrer, acompanhamos a história do concurso mais famoso do país desde sua ascensão até seu declínio. Correndo agora o risco de desaparecer em meio a escândalos enovos padrões de beleza, o documentário traz imagens de arquivo e testemunhos de quem fez parte da trajetória do programa de TV para contar um pouco do sucesso e da queda de um formato que hoje é considerado polêmico e amplamente criticado. A jornada do Miss Itália está intimamente ligada à família de Patrizia Mirigliani, que herdou a competição de seu pai Enzo e está determinada a relançá-lo, apesar dos inúmeros obstáculos. O enredo segue o extenso caminho de busca pelas mais belas da Itália, desde as seleções regionais, as potenciais competidoras e a família de Patrizia.","first_air_date":"2025-02-26","runtime":98,"episode_run_time":[98],"vote_average":0.0,"created_by":["Fremantle Italia","Ring Film"],"production_companies":[{"name":"Fremantle Italia"},{"name":"Ring Film"}],"cast":["Patrizia Mirigliani"],"backdrop_path":"https://image.tmdb.org/t/p/original/4uRVAQUgOOePIkEj7D0CPDVSQXr.jpg","poster_path":"https://image.tmdb.org/t/p/original/b9B3D8pMyBaFsOn9D7YTyhpnU7y.jpg","certification":"N/A","genres":["Documentário"],"trailer":"N/A"},
