"413846":{"id":"413846","name":"1992","slug":"1992","original_title":"1992","overview":"Do produtor executivo Snoop Dogg, 1992 é um tenso thriller policial que acompanha Mercer (Tyrese Gibson), que luta desesperadamente para reconstruir sua vida e sua relação com seu filho (Christopher A’mmanuel) em meio à turbulência da revolta em Los Angeles de 1992, após o veredicto do caso Rodney King. Do outro lado da cidade, outro pai e filho (Ray Liotta e Scott Eastwood) colocam sua relação já conturbada à prova ao planejar um perigoso assalto na fábrica onde Mercer trabalha. Com o aumento das tensões em Los Angeles e o caos tomando conta, ambas as famílias chegam ao seu limite quando seus destinos se cruzam.","first_air_date":"2024-08-29","runtime":97,"episode_run_time":[97],"vote_average":6.9,"created_by":["Trident Films","Death Row Pictures","Sumatra Films","Lionsgate"],"production_companies":[{"name":"Trident Films"},{"name":"Death Row Pictures"},{"name":"Sumatra Films"},{"name":"Lionsgate"}],"cast":["Tyrese Gibson","Scott Eastwood","Ray Liotta","Dylan Arnold","Oleg Taktarov"],"backdrop_path":"https://image.tmdb.org/t/p/original/pbmlCNeOwvCqum8yvMERbgnrSr7.jpg","poster_path":"https://image.tmdb.org/t/p/original/HV5hFJsqogckCfHiAwgKpP9R1j.jpg","certification":"16","genres":["Crime","Thriller","Ação"],"trailer":"N/A"},
